// transforms dataURI into blob
global.atob = require("atob");
const Blob = require('node-blob');
var aws = require('aws-sdk'); 
require('dotenv').config();

let myDataUri = 'data:image/jpeg;base64,'

// turns dataURI into blob
function dataURItoBlob(dataURI) {
    var binary = atob(dataURI.split(',')[1]);
    var array = [];
    for(var i = 0; i < binary.length; i++) {
        array.push(binary.charCodeAt(i));
    }
    return new Blob([new Uint8Array(array)], {type: 'image/jpeg'});
}
//console.log(dataURItoBlob(myDataUri));  
let myImage = dataURItoBlob(myDataUri);

const base64Data = new Buffer.from(myDataUri.replace(/^data:image\/\w+;base64,/, ""), 'base64');
